import React from 'react'
import {connect} from 'react-redux'
import {
    AuthorWrap,
    AuthorTop
} from '../style'
function Author () {
    return (
        <AuthorWrap>
            <AuthorTop>
                <span>推荐作者</span>
                <button><i className="icon"></i> 换一批</button>
            </AuthorTop>
        </AuthorWrap>
    )
}
export default connect(null, null)(Author)
